import React from "react";
import Flex from "./layout/Flex";

const Links = () => {
  const links = [
    {
      name: "Twitter Link",
    },
    {
      name: "Zuri Team",
    },
    {
      name: "Zuri Books",
    },
    {
      name: "Python Books",
    },
    {
      name: "Background Check for Coders",
    },
    {
      name: "Design Books",
    },
  ];
  return (
    <div className="bordered links-padding">
      <Flex stack={true} spacing={24}>
        {links.map((link) => {
          return (
            <Flex
              className="bordered bg-gray"
              jc="center"
              style={{
                paddingTop: "24px",
                paddingBottom: "24px",
                borderRadius: "8px",
              }}
            >
              <p>{link.name}</p>
            </Flex>
          );
        })}
      </Flex>
    </div>
  );
};

export default Links;
